out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters
uniform float u_speed;
uniform float u_fish_scale;
uniform float u_swarm_density;
uniform float u_caustic_intensity;
uniform float u_water_fog;
uniform float u_coral_warmth;
uniform float u_camera_dist;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float hash(float n) { return fract(sin(n) * 43758.5453123); }

float noise(vec3 x) {
    vec3 p = floor(x);
    vec3 f = fract(x);
    f = f * f * (3.0 - 2.0 * f);
    float n = p.x + p.y * 57.0 + 113.0 * p.z;
    return mix(mix(mix(hash(n + 0.0), hash(n + 1.0), f.x),
                   mix(hash(n + 57.0), hash(n + 58.0), f.x), f.y),
               mix(mix(hash(n + 113.0), hash(n + 114.0), f.x),
                   mix(hash(n + 170.0), hash(n + 171.0), f.x), f.y), f.z);
}

// --- GEOMETRY ---

// Simple Fish SDF
float sdFish(vec3 p, float id) {
    float t = iTime * u_speed * 1.5 + id * 20.0;

    // Swimming motion (wiggle)
    float wiggle = sin(p.z * 4.0 - t * 4.0) * 0.15;
    p.x += wiggle;

    // Body - Elongated ellipsoid
    vec3 p_body = p;
    p_body.y *= 1.8;
    float body = length(p_body * vec3(1.2, 1.0, 0.5)) - 0.25;

    // Fin/Tail (simplified)
    float tail = length(p + vec3(0.0, 0.0, 0.4)) - 0.1;

    return min(body, tail) * 0.7;
}

// Coral / Floor
float sdReef(vec3 p) {
    float h = noise(p * 0.5) * 1.5;
    h += noise(p * 2.0) * 0.2;
    return p.y + 3.5 - h;
}

// Swarm Management
float map(vec3 p) {
    // 1. The Reef
    float reef = sdReef(p);

    // 2. The Fish Swarm
    // Repeated domain for fish
    vec3 pf = p;
    float spacing = 4.0 / u_swarm_density;

    // Add swarm-wide movement
    pf.z -= iTime * u_speed * 2.0;
    pf.y += sin(pf.z * 0.2) * 2.0;
    pf.x += cos(pf.z * 0.15) * 3.0;

    vec3 id = floor((pf + spacing * 0.5) / spacing);
    pf = mod(pf + spacing * 0.5, spacing) - spacing * 0.5;

    // Jitter individual fish positions within their cell
    pf.x += (hash(id.x + id.y + id.z) - 0.5) * spacing * 0.6;
    pf.y += (hash(id.y * 1.5 + id.z) - 0.5) * spacing * 0.6;

    float fish = sdFish(pf, hash(id.x * 11.0 + id.z));

    return min(reef, fish);
}

// --- LIGHTING ---

// Procedural Caustics
float getCaustics(vec2 uv) {
    vec2 p = uv * 0.5;
    float t = iTime * u_speed * 0.5;

    vec2 p1 = p;
    p1.x += t * 0.1;
    float n1 = noise(vec3(p1 * 4.0, t));

    vec2 p2 = p;
    p2.y -= t * 0.15;
    float n2 = noise(vec3(p2 * 5.0, t * 0.8));

    return pow(min(n1, n2), 2.5) * 10.0;
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Camera movement
    float t = iTime * u_speed * 0.5;
    vec3 ro = vec3(u_camera_dist * cos(t * 0.2), 1.0 + sin(t * 0.1), t * 4.0);
    vec3 ta = vec3(0.0, 0.0, ro.z + 5.0);

    // Look-at matrix
    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0.0, 1.0, 0.0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd + uv.x * right + uv.y * up);

    // Raymarching
    float d = 0.0, dist = 0.0;
    for(int i = 0; i < 80; i++) {
        d = map(ro + rd * dist);
        if(d < 0.001 || dist > 40.0) break;
        dist += d;
    }

    // Background Gradient (Deep Water)
    vec3 deepBlue = vec3(0.0, 0.05, 0.1);
    vec3 shallowBlue = vec3(0.0, 0.4, 0.5);
    vec3 skyColor = mix(deepBlue, shallowBlue, rd.y * 0.5 + 0.5);

    vec3 col = skyColor;

    if(dist < 40.0) {
        vec3 p = ro + rd * dist;
        vec3 nor = getNormal(p);
        vec3 lightDir = normalize(vec3(1.0, 5.0, 2.0));

        // Base shading
        float diff = max(dot(nor, lightDir), 0.0);

        // Caustics on surfaces
        float caustics = getCaustics(p.xz + p.y);

        // Differentiate fish from reef
        if (p.y > -2.5) {
            // Fish Color (Silver/Orange mix)
            vec3 fishCol = mix(vec3(0.8, 0.8, 0.9), vec3(1.0, 0.6, 0.2), u_coral_warmth);
            col = fishCol * (diff + 0.2) + caustics * u_caustic_intensity * 0.2;
        } else {
            // Reef Color (Warm Oranges/Purples)
            vec3 reefCol = mix(vec3(0.2, 0.1, 0.1), vec3(0.8, 0.4, 0.3), u_coral_warmth);
            reefCol *= noise(p * 3.0);
            col = reefCol * (diff + 0.1) + caustics * u_caustic_intensity * 0.3;
        }

        // Underwater Fog/Distance Attenuation
        float fog = exp(-dist * (0.1 / u_water_fog));
        col = mix(skyColor, col, fog);
    }

    // Volumetric Rays (Cheap fake)
    float rays = getCaustics(uv * 2.0 + iTime * 0.1);
    col += rays * 0.1 * u_caustic_intensity * max(0.0, rd.y);

    // Vignette
    col *= 1.0 - length(uv) * 0.5;

    // Tone mapping
    col = pow(col, vec3(0.4545));

    fragColor = vec4(col, 1.0);
}
